import React from 'react';
import Counter from './components/conuter';
import './App.css'

function App() {
  return (
    <div className="App">
      <header>
        <h1 className="App-title">Licznik React</h1>
      </header>
      <Counter nazwa={'Klasowy 1'} cos={'!!'}/>
      <Counter nazwa={'Klasowy 2'}/>
      <Counter nazwa={'Klasowy 3'}/>
      <Counter nazwa={'Klasowy 4'}/>
    </div>
  );
}

export default App;
